import React, { Component } from 'react'
import X from './download (3).jpeg'

class Store extends Component {
    render() {
        return(
            <div>
                <div className='container' >
                    <h4>Grids</h4>

                    <div className='row' >
                        <img src={X} alt='Hello' />
                        <div className='col s3 blue' >Hello</div>


                        <div className='col s3 yellow' >Hello</div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Store
